    static int deepSearch(HashMap<Integer, Set<Integer>> map, HashSet<Integer> used, int from) {
        int result = 1;
        used.add(from);
        for (Integer vertex : map.get(from)) {
            if (!used.contains(vertex)) result += deepSearch(map, used, vertex);
        }
        return result;
    }
